@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'toDoList';
}
<h1>My To-Do List</h1>

<ul>
  <li>Task 1</li>
  <li>Task 2</li>
  <li>Task 3</li>
</ul>
